import React, { useEffect } from "react";

const App = () => {
  useEffect(() => {
    const iframe = document.getElementById("myIframe");

    iframe.addEventListener("load", function() {
      // Make sure the iframe content is loaded before attaching events
      iframe.contentWindow.document.addEventListener("click", function(e) {
        console.log("Element clicked:", e.target);
        // Do something with the clicked element, e.g., send its ID to the parent
      });
    });
  }, []);

  const iframeStyle = {

    width: "100%",
    height: "100%",
    border: "none"
  };


  return (
    <div className="App">
      <iframe id="myIframe" src="path/to/your/html/file.html" style={iframeStyle}></iframe>
    </div>
  );
};

export default App;
